import React from 'react';

function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li><a href="https://www.instacart.com/store/">Home</a></li>
          <li><a href="https://www.instacart.com/store/">About</a></li>
          <li><a href="https://www.instacart.com/store/">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
